    const [navRef, setRef] = useState('')
    useEffect(() => {
        console.log(handleRefObj[navRef]())
    }, [navRef])
    return (
        <NavBarContainer>
            <NavigationContainer>
                <NavigationButton onClick={() => setRef('about')}>About</NavigationButton>
                <NavigationButton onClick={() => setRef('experience')}>Experience</NavigationButton>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
